UML:TaggedValue.value:
The abstract SoilFeature class represents a conceptual feature that is hypothesized to exist coherently in the world. * this corresponds with a "Soil Unit", comprising a set of similar soil profiles with a mappable distribution in some "Soil Landscape", a Soil Profile or its constituent parts;
The implemented SoilFeature instance acts as the "description package"
* the description package is classified according to its purpose as an Instance, TypicalNorm, or DefiningNorm.
